import React,{Component} from "react";
import { Link } from 'react-router-dom';
import './Home.css';

class Home extends Component{

  render () {
    return (
      <div className="Home-header">
          <button type="button" className="button"> <Link to="/signIn"> Iniciar Sesion </Link></button> 
      </div>
    );
  }
}
export default Home;
